import React, { Component } from "react";
import {Row, Col, TextInput} from 'react-materialize'
class Profile extends Component {
    render() {
        return (
            <div>
                <h1>User Profile</h1>
                <form>
                    <Row >
                        <Col s={12}>

                            <TextInput className="s12" label="First Name" />
                        </Col>
                    </Row>
                </form>
            </div>
        )
    }
}

export default Profile
